// Header.js

import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import two from '../assets/Images/2nd ALL TIME CHILLERS.jpg'
import MenuOne from './MenuOne';
import MenuTwo from './MenuTwo';
import MenuThree from './MenuThree';
import MenuFour from './MenuFour';
import MenuFive from './MenuFive';

function Header() {
  const navigate = useNavigate();

  const handleTabClick = (event, path) => {
    event.preventDefault();
    navigate(path);
  };

  return (
    <div className="container-fluid rounded-4">
      <div className="row mt-3">
        <ul className="nav nav-tabs">
          <li className="nav-item">
            <Link className="nav-link active" to="/home/menu-one">
              <MenuOne />
            </Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/home/menu-two">
              <MenuTwo />
            </Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/home/menu-three">
              <MenuThree />
            </Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/home/menu-four">
              <MenuFour />
            </Link>
          </li>
          <li className="nav-item">
            <Link className="nav-link" to="/home/menu-five">
              <MenuFive />
            </Link>
          </li>
        </ul>
      </div>
    </div>
  );
}

export default Header;
